- input: "TEXT\x1CC00041269\x1CX0\x1C\x1CF3XN\x1CPayments for 'Payroll,' 'Payroll
    Taxes' and 'Health Insurance' on Schedule H4 are for those individuals who did
    not spend more than 25% of their time during the period on activity in connection
    with a federal election. The receipt on Line 17 are for voter file purchases.
    The prices paid for voter file purchases are established using comparable prices
    charged by other state party committees throughout the country on a per record
    cost. The exact price paid to the Committee by each entity is determined by multiplying
    the per record cost by the number of records provided in the file purchased. Allocation
    transfers reported on Schedule H3 for Line 18 contain allocable transactions that
    occurred at the end of 2010.\n"
